import * as React from 'react';
import { View, Text, StyleSheet, TouchableOpacity } from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';
import Calculator from './Calculator';
import QuickNotes from './QuickNotes';

const Stack = createNativeStackNavigator();

const HomeScreen = ({ navigation }) => {
  const navigateToProfile = () => {
    navigation.navigate('Profile', { name: 'TBD' });
  };

  const navigateToCalculator = () => {
    navigation.navigate('Calculator');
  };

  const navigateToQuickNotes = () => {
    navigation.navigate('QuickNotes');
  };

  return (
    <View style={styles.container}>
      {/* ... */}
      <View style={styles.buttonContainer}>
        <TouchableOpacity
          style={[styles.button, { backgroundColor: '#007BFF' }]}
          onPress={navigateToProfile}
        >
          <Text style={styles.buttonText}>Your Profile!</Text>
        </TouchableOpacity>
      </View>
      <View style={styles.buttonContainer}>
        <TouchableOpacity
          style={[styles.button, { backgroundColor: '#FFC107' }]}
          onPress={navigateToCalculator}
        >
          <Text style={styles.buttonText}>Calculator</Text>
        </TouchableOpacity>
      </View>
      <View style={styles.buttonContainer}>
        <TouchableOpacity
          style={[styles.button, { backgroundColor: '#DC3545' }]}
          onPress={navigateToQuickNotes}
        >
          <Text style={styles.buttonText}>Off the top</Text>
        </TouchableOpacity>
      </View>
    </View>
  );
};

const ProfileScreen = ({ navigation, route }) => {
  return <Text>Welcome {route.params.name}! Here you will be able to keep track of your stats and achievements!</Text>;
};

const MyStack = () => {
  return (
    <NavigationContainer>
      <Stack.Navigator>
        <Stack.Screen
          name="Home"
          component={HomeScreen}
          options={{ headerShown: false }}
        />
        <Stack.Screen name="Profile" component={ProfileScreen} />
        <Stack.Screen name="Calculator" component={Calculator} />
        <Stack.Screen name="QuickNotes" component={QuickNotes} />
      </Stack.Navigator>
    </NavigationContainer>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center',
    padding: 16,
  },
  title: {
    fontSize: 24,
    fontWeight: 'bold',
    marginBottom: 16,
  },
  buttonContainer: {
    marginBottom: 16,
  },
  button: {
    borderRadius: 50,
    backgroundColor: '#007BFF',
    paddingVertical: 52,
    paddingHorizontal: 24,
  },
  buttonText: {
    color: '#fff',
    fontSize: 18,
    fontWeight: 'bold',
    textAlign: 'center',
  },
});

export default MyStack;
